const Home = () => {

    function CreateButton(props) {
        return <a href={props.link}><button type="button" class="btn btn-primary btn-lg">{props.value}</button></a>;
      }

    return(
        <div className="home">
            <h1>Hello World</h1>
            <h1>Inventory Management System</h1>
            <div class='container'>
                <div class='row align-items-center' style={{height: 100}}>
                    <div class='col'>
                        <CreateButton link='/checkin' value="Check-In"/>
                    </div>
                    <div class='col'>
                        <CreateButton link='/checkout' value="Check-Out"/>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
